import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>

    <div>
    <App />
    <br>
    </br>
    <hr>
    </hr>
    <App />
    <App />

    </div>
  </React.StrictMode>
);
